    "2016-07-15T19:13:02.251640",nt"name": "quarterly-services-survey",nt"isopen":
    true,nt"url": null,nt"notes": "The Quarterly Services Survey (QSS) is the
    only source of service industry indicator performance providing timely estimates
    of revenue and expenses for selected service industries. The Bureau of Economic
    Analysis (BEA) is the primary Federal user of data collected in the QSS. The BEA
    utilizes this timely data to factor into the Gross Domestic Product (GDP) to make
    improvements to the national accounts for service industries. QSS estimates also
    provide the Federal Reserve Board (FRB) and Council of Economic Advisors (CEA) with
    timely information on current economic performance. The Centers for Medicare and
    Medicaid Services (CMS) use the QSS data to develop hospital-spending estimates
    in the National Accounts. In addition,  the QSS data improves their ability to analyze
    hospital-spending trends.",nt"license_title": "U.S. Government Work",nt"extras":
